document.addEventListener("DOMContentLoaded",function(){if("loading"in HTMLImageElement.prototype){document.querySelectorAll("img[loading='lazy']").forEach(e=>{e.dataset.src&&(e.src=e.dataset.src)})}else{const e=document.createElement("script");e.src="https://cdnjs.cloudflare.com/ajax/libs/lazysizes/5.3.2/lazysizes.min.js",e.onload=function(){window.lazySizes&&window.lazySizes.init()},document.body.appendChild(e)}});